import React, { Component } from "react";
import classes from "./show.module.css";
class Show extends Component {
  render() {
    let data = this.props.data;
    return (
      <tr>
        <td>{data[0]}</td>
        <td>{data[1]}</td>
        <td>{data[2]}</td>
        <td>{data[3]}</td>
      </tr>
    );
  }
}
export default Show;
